import { useQuery } from "@tanstack/react-query";

function App() {
  async function getPosts() {
    const response = await fetch(`https://jsonplaceholder.typicdoe.com/posts`);
    return await response.json();
  }

  const { data: postsData } = useQuery({
    queryKey: ["posts"],
    queryFn: getPosts,
  });

  const queryResult = useQuery({
    queryKey: ["posts"],
    queryFn: getPosts,
  });

  console.log("queryResult", queryResult);

  return <div>tanstack query 실습!</div>;
}

export default App;
